import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="container">
      <div className="header">
        <h1>Header</h1>
      </div>
      <div className="content">
        <div className="section">
          <h2>Title 1</h2>
          <p>Content 1</p>
        </div>
        <div className="section">
          <h2>Title 2</h2>
          <p>Content 2</p>
        </div>
        <div className="section">
          <h2>Title 3</h2>
          <p>Content 3</p>
        </div>
      </div>
    </div>
  );
};

export default App;
